export const CARD_INFO = () => {
    // CARD_DESC
    const cardList = res.find(item => item.id === 'Cards')?.entries;
    return cardList.map(item => {
        const current = CARD_DESC.find(c => c.name === item.text);
        if (!current) return item;
        return {
            ...item,
            stack: current.stack.replace(/\s/g, ''),
            explicitMod: current.explicitMod
        };
    });
};

export default res;